export let USERS = [
    { name: 'phillip', lastname: 'rekhotho' },
    { name: 'octavia', lastname: 'miller' }
]

export let addUser = (cb) => {
    USERS.push({ name: 'newUser', lastname: 'newLastname' })
    cb()
}
